import React, { useState } from 'react';
import './App.css';

function App() {
  const [address, setAddress] = useState('');
  const [area, setArea] = useState('');
  const [numRooms, setNumRooms] = useState('');

  const handleAddressChange = (event) => {
    setAddress(event.target.value);
  };

  const handleAreaChange = (event) => {
    setArea(event.target.value);
  };

  const handleNumRoomsChange = (event) => {
    setNumRooms(event.target.value);
  };

  return (
    <div className="App">
      <div className="container">
        <h1>Ввод данных о недвижимости</h1>
        <label>
          Адрес объекта:
          <input type="text" value={address} onChange={handleAddressChange} />
        </label>
        <br />
        <label>
          Количество квадратных метров:
          <input type="number" value={area} onChange={handleAreaChange} />
        </label>
        <br />
        <label>
          Количество комнат:
          <input type="number" value={numRooms} onChange={handleNumRoomsChange} />
        </label>
      </div>
    </div>
  );
}

export default App;
